import React from "react";
import Button from "@material-ui/core/Button";
import Snackbar from "@material-ui/core/Snackbar";

export default function AlertMessage(props) {
  const { open } = props;

  return (
    <div>
      <Snackbar
        anchorOrigin={("top", "right")}
        open={open}
        message="I love snacks"
      />
    </div>
  );
}
